import React from "react";
import '../assets/css/TagTwoBtn.css';
import classNames from 'classnames';
class TagTwoBtn extends React.Component {

  render() {
    const resetCss=classNames("TagTwoBtnLeft",{"TagTwoBtnReset":this.props.resetAble});
    return (
      <div className={"TagTwoBtnBox"}>
         <div className={resetCss} onClick={()=>{this.props.reset&&this.props.reset();}}>重置</div>
         <div className="TagTwoBtnRight" onClick={()=>{this.props.reset&&this.props.submit();}}>确定</div>
      </div>
    );
  }
}

export default TagTwoBtn;
